import React from 'react';
import { motion } from 'framer-motion';
import { FaLinkedin, FaGithub, FaEnvelope, FaPhone } from 'react-icons/fa';
import './FullScreenContact.css';

const containerVariants = {
  hidden: { opacity: 0, y: 50 },
  visible: { opacity: 1, y: 0 }
};

const FullScreenContact = () => {
  return (
    <section id="contact" className="full-screen-contact">
      <motion.div
        className="contact-container"
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true, amount: 0.5 }}
        variants={containerVariants}
        transition={{ type: 'spring', stiffness: 80, damping: 20 }}
      >
        <h2>Let's Connect</h2>
        <p>Iâ€™d love to hear from you! Drop a message or connect with me on social media.</p>
        <div className="contact-info">
          <a href="mailto:your-email@example.com" className="contact-link">
            <FaEnvelope className="contact-icon" />
            <span>Email</span>
          </a>
          <a href="tel:+15551234567" className="contact-link">
            <FaPhone className="contact-icon" />
            <span>Call Me</span>
          </a>
          <a
            href="https://linkedin.com/in/your-profile"
            target="_blank"
            rel="noopener noreferrer"
            className="contact-link"
          >
            <FaLinkedin className="contact-icon" />
            <span>LinkedIn</span>
          </a>
          <a
            href="https://github.com/your-username"
            target="_blank"
            rel="noopener noreferrer"
            className="contact-link"
          >
            <FaGithub className="contact-icon" />
            <span>GitHub</span>
          </a>
        </div>
      </motion.div>
    </section>
  );
};

export default FullScreenContact;
